import Select from 'react-select';

import countryIcon from "../assets/img/landingPage/countryIcon.png";
import sectorIcon from "../assets/img/landingPage/sector-icon.png";
import './LandingPage.css'


function SelectWorldOrSector(props) {
    const customStyles = {
        control: base => ({
          ...base,
          height: 35,
          minHeight: 35
        })
      };
  return (

      props.tabswitch === "სექტორების" ? (
        <Select
          name="sector"
          id="sector"
          style={{
            backgroundImage: `url(${sectorIcon})`,
            backgroundRepeat: "no-repeat",
            width: "100%",
            backgroundPosition: "right 6% top 50%",
            
            
          }}
          className="basic-single"
          classNamePrefix="select"
          defaultValue={colourOptions[0]}
          isDisabled={isDisabled}
          isLoading={isLoading}
          isClearable={isClearable}
          isRtl={isRtl}
          isSearchable={isSearchable}
          options={colourOptions}
          styles={customStyles}
        >
          <option value="2021">აირჩიეთ სასურველი სექტორი</option>
          <option>სოფლის მეურნეობა, თევზჭერა</option>
          <option value="2018">2018</option>
          <option value="2017">2017</option>
          <option value="2016">2016</option>
          <option value="2015">2015</option>
          <option value="2014">2014</option>
          <option value="2013">2013</option>
          <option value="2012">2012</option>
          <option value="2011">2011</option>
          <option value="2010">2010</option>
          <option value="2009">2009</option>
          <option value="2008">2008</option>
          <option value="2007">2007</option>
        </Select>
      ) : (
        <select
          name="country"
          id="country"
          style={{
            backgroundImage: `url(${countryIcon})`,
            backgroundRepeat: "no-repeat",
            width: "100%",
            backgroundPosition: "right 6% top 50%",
          }}
        >
          <option value="2021">აირჩიეთ სასურველი ქვეყანა</option>
          <option value="2020">2020</option>
          <option value="2019">2019</option>
          <option value="2018">2018</option>
          <option value="2017">2017</option>
          <option value="2016">2016</option>
          <option value="2015">2015</option>
          <option value="2014">2014</option>
          <option value="2013">2013</option>
          <option value="2012">2012</option>
          <option value="2011">2011</option>
          <option value="2010">2010</option>
          <option value="2009">2009</option>
          <option value="2008">2008</option>
          <option value="2007">2007</option>
        </select>
      )

  );
}
export default SelectWorldOrSector;
